const TimerList = () => {
 return (
  <ul className="timers-wrap">
   {
    [1, 2, 3, 4, 5, 6, 7].map(item => {
     return (
      <li className="timers-item">
       <div className="left">
        <i className="def-bank-icon"></i>
        <span>中国邮政</span>
       </div>
       <div className="min">
        <span>【万】¥1890.00</span>
